import React from 'react';
class ImageCard extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			spans: 0,
		};
		this.imageRef = React.createRef();
	}

	render() {
		return <img src={this.props.image.urls.regular} alt='' />;
	}
}

export default ImageCard;
